export const PostData = [
  {
    img: postPic1,
    name: "Tzuyu",
    desc: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Corporis, nostrum.",
    likes: 7629,
    liked: true,
  },
  {
    img: postPic2,
    name: "Hani",
    desc: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Corporis, nostrum.",
    likes: 3345,
    liked: false,
  },
  {
    img: postPic3,
    name: "Miya",
